import React, { useEffect, useState } from 'react';
import { makeStyles } from '@mui/styles';
import TextField from '@mui/material/TextField';
import { Container ,Paper,Button,Box} from '@mui/material';
import { FilledInput, IconButton,InputAdornment } from "@mui/material";
import { VisibilityOffOutlined, VisibilityOutlined } from "@mui/icons-material";
import {MenuItem} from '@mui/material';
import {Select,InputLabel,FormControl} from '@mui/material';

const useStyles = makeStyles((theme) => ({
  // root: {
  //   '& > *': {
  //     margin: theme.spacing(1),
  //   },
  // },
}));

export default function Student() {
  console.log("jjj")
    const paperStyle={padding:'50px 20px', width:600,margin:"20px auto"}
    const[name,setName]=useState('')
    const[address,setAddress]=useState('')
    const[role,setRole]=useState('')
    const[password,setPassword]=useState([])
    const[students,setStudents]=useState([])
    const [psw, setPsw] = useState(false);
    const handleShowPsw = () => setPsw((show) => !show);
    const handleHidePsw = (e) => {
      e.preventDefault();
   };
    const classes = useStyles();

  const register=(e)=>{  
    e.preventDefault()
    const student={name,address}
    console.log(student)
    if(role===1)
    {
        fetch("http://localhost:8080/authorization/addTeacher",{
          method:"POST",
          headers:{"Content-Type":"application/json"},
          body:JSON.stringify(student)

      }).then(()=>{
        console.log("New Teacher added")
      })
    }
    else{
      fetch("http://localhost:8080/authorization/addStudent",{
        method:"POST",
        headers:{"Content-Type":"application/json"},
        body:JSON.stringify(student)

    }).then(()=>{
      console.log("New Student added")
    })
  }
}
  const login=(e)=>{  
    e.preventDefault()
    const student={name,address}
    if(role===1)
      {
          fetch("http://localhost:8080/authorization/loginTeacher",{
            method:"POST",
            headers:{"Content-Type":"application/json"},
            body:JSON.stringify(student)

        })
        .then((result)=>{
          console.log('Fetchedll students:', result); // Dodaj t

        }).catch(error => console.error('Error logging students:', error));
      }
      else{
        fetch("http://localhost:8080/authorization/loginStudent",{
          method:"POST",
          headers:{"Content-Type":"application/json"},
          body:JSON.stringify(student)

      }).then(res=>res.json())
      .then((result)=>{
        console.log('Fetchedlll students:', result); // Dodaj t
      }).catch(error => console.error('Error logging students:', error));
    }


}

useEffect(()=>{
  fetch("http://localhost:8080/authorization/getAllTeachers")
  .then(res=>res.json())
  .then((result)=>{
    console.log('Fetched students:', result); // Dodaj t
    setStudents(result);
  }
).catch(error => console.error('Error fetching students:', error));
},[])
  return (

    <Container>
        <Paper elevation={3} style={paperStyle}>
            {/* <h1 style={{color:"blue"}}><u>Zarejestruj się</u></h1> */}

    <form className={classes.root} noValidate autoComplete="off">
    <FormControl fullWidth>
    <InputLabel id="role-label">Rola</InputLabel>
    <Select
    labelId="role-label"
    value={role}
    // fullWidth
    onChange={(e)=>setRole(e.target.value)}
  >
    <MenuItem value={0}>Uczeń</MenuItem>
    <MenuItem value={1}>Nauczyciel</MenuItem>
  </Select>
  </FormControl>
      <TextField id="outlined-basic" label="login" variant="outlined" fullWidth 
      value={name}
      onChange={(e)=>setName(e.target.value)}
      />
      <TextField id="outlined-basic" label="email" variant="outlined" fullWidth
      value={address}
      onChange={(e)=>setAddress(e.target.value)}
      />
      <FilledInput
              value={password}
              onChange={(e)=>setPassword(e.target.value)}
              type={psw ? 'text' : 'password'}
              fullWidth
              endAdornment={
                  <InputAdornment position="start">
                     <IconButton
                        onClick={handleShowPsw}
                        onMouseDown={handleHidePsw}
                        edge="end"
                     >
                        {psw ? <VisibilityOffOutlined /> : <VisibilityOutlined />}

                     </IconButton>

                  </InputAdornment>
               }
            />
       <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center' }}>

       <Box display="flex" flexDirection="column" gap={2}>
      <Button variant="contained" color="secondary" onClick={register}>
        Zarejestruj
      </Button>
      <Button variant="contained" color="secondary" onClick={login}>
        Zaloguj
      </Button>
      </Box>
    </div>
    </form>

    </Paper>
    <h1>Students</h1>
{
    <Paper elevation={3} style={paperStyle}>

      {students.map(student=>(
        <Paper elevation={6} style={{margin:"10px",padding:"15px", textAlign:"left"}} key={student.id}>
         Id:{student.id}<br/>
         Name:{student.name}<br/>
         Address:{student.address}

        </Paper>
      ))
}
    </Paper> }
    </Container>
  );
}
